window.bookSummaryJSON = "<p><b>Once upon a tangled tale of broken hearts and blackened souls comes this dark fairy-tale retelling from the </b><b><i>Wall Street Journal</i></b><b> and Amazon number one best-selling fantasy romance authors of Zodiac Academy.</b></p> <p>A twisted heart, a hollow soul.</p> <p>A broken warrior, lost gods of old.</p> <p>A thief of shadows, blessed with light;</p> <p>A single lie which stole their might.</p> <p>A princess to win, in a brutal game.</p> <p>A great empire falling to a monster’s claim.</p> <p>A forbidden love, a curse untold.</p> <p>The last immortal trapped in a coin of gold.</p> <p><i>Caroline Peckham and Susanne Valenti have sold millions of books worldwide and have become known as the Twisted Sisters due to their dark and decadent romances full of heart-stopping angst. Step into this world of Fae, gods, and curses unlike any retelling you’ve experienced before.</i></p>"; 
